[{"location":"#TensorCalculus.jl","page":"Home","title":"TensorCalculus.jl","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for TensorCalculus.jl","category":"page"},{"location":"","page":"Home","title":"Home","text":"Tensor","category":"page"},{"location":"#TensorCalculus.Tensor","page":"Home","title":"TensorCalculus.Tensor","text":"Tensor{T<:Number,N}\n\nWrapper type for native Julia arrays. Provides most of the standard array functionality and extends it by arithmetic and algebraic tensor operations.\n\nExamples\n\njulia> t1 = Tensor([1 2; 3 4])\n2×2 Tensor{Int64, 2}:\n 1  2\n 3  4\n\njulia> 3.14 * t1\n2×2 Tensor{Float64, 2}:\n 3.14   6.28\n 9.42  12.56\n\njulia> t2 = Tensor(Float32[1.1, -2.2, 3.3])\n3-element Tensor{Float32, 1}:\n  1.1\n -2.2\n  3.3\n\njulia> t1 ⊗ t2\n2×2×3 Tensor{Float32, 3}:\n[:, :, 1] =\n 1.1  2.2\n 3.3  4.4\n\n[:, :, 2] =\n -2.2  -4.4\n -6.6  -8.8\n\n[:, :, 3] =\n 3.3   6.6\n 9.9  13.2\n\njulia> foo(t1) 10.0\n\n\n\n\n\n","category":"type"}]
